import React, { useState } from 'react';
import { 
  Box, 
  Typography, 
  TextField, 
  Button, 
  Grid, 
  Paper, 
  CircularProgress,
  Container
} from '@mui/material';
import { generateAds } from '../../services/api';
import '../../styles/AdGeneration.css';

const GenerateAd = () => {
  // Only keep image and video types, remove text
  const [adType, setAdType] = useState('image');
  const [description, setDescription] = useState('');
  const [advertisementGoals, setAdvertisementGoals] = useState('');
  const [targetAudience, setTargetAudience] = useState('');
  const [adOptions, setAdOptions] = useState([]);
  const [loading, setLoading] = useState(false);

  const handleGenerateAd = async () => {
    setLoading(true);
    try {
      const response = await generateAds({
        ad_format: adType,
        description,
        advertisement_goals: advertisementGoals,
        target_audience: targetAudience
      });

      setAdOptions(response.options || []);
    } catch (error) {
      console.error('Error generating ad:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="lg">
      <Typography variant="h4" gutterBottom align="center">
        AI Advertisement Generator
      </Typography>

      <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
        <Typography variant="h6" gutterBottom>
          Generate Advertisement
        </Typography>

        <Grid container spacing={2}>
          {/* Only show image and video options */}
          <Grid item xs={12} sm={6}>
            <Button 
              fullWidth
              variant={adType === 'image' ? 'contained' : 'outlined'}
              onClick={() => setAdType('image')}
              sx={{ height: '100%' }}
            >
              Image Advertisement
            </Button>
          </Grid>
          <Grid item xs={12} sm={6}>
            <Button 
              fullWidth
              variant={adType === 'video' ? 'contained' : 'outlined'}
              onClick={() => setAdType('video')}
              sx={{ height: '100%' }}
            >
              Video Advertisement
            </Button>
          </Grid>

          <Grid item xs={12}>
            <TextField
              fullWidth
              label="Business/Product Description"
              multiline
              rows={3}
              value={description}
              onChange={(e) => setDescription(e.target.value)}
            />
          </Grid>

          <Grid item xs={12}>
            <TextField
              fullWidth
              label="Advertisement Goals"
              multiline
              rows={2}
              value={advertisementGoals}
              onChange={(e) => setAdvertisementGoals(e.target.value)}
            />
          </Grid>

          <Grid item xs={12}>
            <TextField
              fullWidth
              label="Target Audience"
              multiline
              rows={2}
              value={targetAudience}
              onChange={(e) => setTargetAudience(e.target.value)}
            />
          </Grid>
        </Grid>

        <Button 
          variant="contained" 
          color="primary" 
          fullWidth 
          sx={{ mt: 2 }}
          onClick={handleGenerateAd}
          disabled={loading || !description || !advertisementGoals || !targetAudience}
        >
          {loading ? <CircularProgress size={24} /> : 'Generate Advertisement'}
        </Button>
      </Paper>

      {/* Display generated options with increased size */}
      {adOptions.length > 0 && (
        <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
          <Typography variant="h6" gutterBottom>
            Generated Options
          </Typography>

          <Grid container spacing={3}>
            {adOptions.map((option, index) => (
              <Grid item xs={12} key={index}>
                <Paper 
                  elevation={2} 
                  className="ad-option"
                >
                  <Typography variant="h6" gutterBottom>
                    Option {index + 1}
                  </Typography>
                  <div>{option}</div>
                </Paper>
              </Grid>
            ))}
          </Grid>
        </Paper>
      )}
    </Container>
  );
};

export default GenerateAd;
